const ManagerPlaylist = styled.div`

`

class  ManagerPlaylistform extends React.Component {
   state ={
      currentPage: "playlist"
   }

   render () {
      return ( 
         <ManagerPlaylist>
          <Playlists/>
          <PlaylistDetail/>
          </ManagerPlaylist>
         )
   }
  
}

export default ManagerPlaylistform
